import React, { Component } from "react";
import "./App.css";


class MyNFTs extends Component {

  state = {  };

  componentDidMount = async () => {
  };


  render() {
    return (
        <div className="App">
        <h1>My NFTs</h1>
        <div class="nfts">
          {this.props.nfts.map((nft, key) => {
              return (
                <div class="nft">
                  <p>Id: {nft.id}</p>
                  <p>Title: {nft.title}</p>
                  <p>Description: {nft.description}</p>
                  <p>Price: {nft.price}</p>
                  <p>Status: {nft.status}</p>
                </div>
              );
          })}
        </div>
      </div>
    );
  }
}

export default MyNFTs;
